import React, { useEffect, useState, useRef } from "react";
import { io } from "socket.io-client";
import { useNavigate } from "react-router-dom";

function TimeHistory() {
  const [history, setHistory] = useState([]);
  const socketRef = useRef(null);
  const navigate = useNavigate();

  useEffect(() => {
    socketRef.current = io("http://localhost:4005");
    socketRef.current.on("status", (data) => {
      if (data.settings) setHistory(data.settings);
    });
    return () => socketRef.current.disconnect();
  }, []);

  const textHistory = history.filter((item) => item.mode === "text");
  const imageHistory = history.filter((item) => item.mode === "image");

  const handleRemove = (id) => {
    socketRef.current.emit("removeSetting", id);
  };

  return (
    <div className="th-minimal-container">
      <header className="th-minimal-header">
        <button className="th-minimal-back-btn" onClick={() => navigate(-1)}>
          <svg
            width="22"
            height="22"
            viewBox="0 0 24 24"
            stroke="#3949ab"
            strokeWidth="2"
            fill="none"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
          <span>ย้อนกลับ</span>
        </button>
        <div className="th-minimal-title">ประวัติการตั้งเวลา</div>
      </header>
      <main className="th-minimal-main">
        <div className="th-minimal-card">
          <div className="th-minimal-card-title th-text">ข้อความ</div>
          {textHistory.length === 0 ? (
            <div className="th-minimal-empty">ไม่มีประวัติการตั้งค่าข้อความ</div>
          ) : (
            textHistory.map((item) => (
              <div key={item.id} className="th-minimal-item">
                <div>
                  <span className="th-minimal-label">วันที่:</span> {item.date}
                </div>
                <div>
                  <span className="th-minimal-label">ระยะเวลา:</span> {item.duration}
                </div>
                <div>
                  <span className="th-minimal-label">ราคา:</span> {item.price}
                </div>
                <button
                  className="th-minimal-remove-btn"
                  onClick={() => handleRemove(item.id)}
                >
                  ลบ
                </button>
              </div>
            ))
          )}
        </div>
        <div className="th-minimal-card">
          <div className="th-minimal-card-title th-image">รูปภาพ</div>
          {imageHistory.length === 0 ? (
            <div className="th-minimal-empty">ไม่มีประวัติการตั้งค่ารูปภาพ</div>
          ) : (
            imageHistory.map((item) => (
              <div key={item.id} className="th-minimal-item">
                <div>
                  <span className="th-minimal-label">วันที่:</span> {item.date}
                </div>
                <div>
                  <span className="th-minimal-label">ระยะเวลา:</span> {item.duration}
                </div>
                <div>
                  <span className="th-minimal-label">ราคา:</span> {item.price}
                </div>
                <button
                  className="th-minimal-remove-btn"
                  onClick={() => handleRemove(item.id)}
                >
                  ลบ
                </button>
              </div>
            ))
          )}
        </div>
      </main>
    </div>
  );
}

export default TimeHistory;
